export const getAllNotasService = async () => {
  const response = await fetch(`${process.env.REACT_APP_BACK}/notes`);
  const json = await response.json();
  if (!response.ok) {
    throw new Error(json.message);
  }

  return json.data;
};

//Línea 2 (`${process.env.REACT_APP_BACK}/notes`)
